import styled from "styled-components";

export const PageContainer = styled.div`
    margin-bottom: 60px;
    display: flex;
    flex-direction: column;
    p{
        text-align: center;
    }

`;
export const ConteinerInput = styled.div`
  display: flex;
  justify-content: center;
    input{
        width: 75vw;
    }
`;
